import React from 'react'
import '../styles/Navbar.css';

const Navbar = () => {
    return (
        <div className="navbar">
            <h1 className="navbar-title">LAMANE</h1>
            <input className="navbar-search">Buscar</input>
        </div>
    )
}

export default Navbar;
